import {useState} from 'react';

function Menu() {
    const [menus, setMenu] = useState (
      [    
        {
          idmenu: 1, 
          idkategori:1, 
          menu:"Ayam Goreng", 
          gambar:"ayam.jpg", 
          harga:5000
        },
        {
          idmenu: 2, 
          idkategori:1, 
          menu:"Ayam Bakar", 
          gambar:"ayam.jpg", 
          harga:5000
        },
        {
          idmenu: 3, 
          idkategori:2, 
          menu:"Es Teh", 
          gambar:"esteh.jpg", 
          harga:5000
        }
      ]
    )
    return (
      <div className="App">
        <h1>Menu Restoran</h1>
        <div>
          {menus.map((data) =>(
            <li key={data.idmenu}>{data.menu}</li>
          ))}
        </div>
      </div>
    )
  }
  
  export default Menu;
